import React from "react";
import { Link } from "react-router-dom";
import logo from './logo.png'
import Search from "./Search";
import './Header.css'

const Header = () =>{
    return (
        <div className="Header">
            <Link to={'/?page=1'}>
            <img src={logo} alt="" className="Header-logo"/>
            </Link>
            <Search/>
        </div>
    )
}
export default Header
